import React, { Component } from 'react'
import './head.css'

export class head extends Component {
    render() {
        return (
            <div>
                <div id = "totol">
                    <div class="container">
                        <div class="row">
                            <div class="col-lg-12">
                                <h1 id="title mt-2">EDICRUX</h1>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        )
    }
}

export default head
